// src/components/Paper.jsx
import React, { useState } from "react";
import { Document, Page } from "react-pdf";
import { GlobalWorkerOptions, version as pdfjsVersion } from "pdfjs-dist";
import "./Paper.css";

// Worker setup
GlobalWorkerOptions.workerSrc = `//cdnjs.cloudflare.com/ajax/libs/pdf.js/${pdfjsVersion}/pdf.worker.min.js`;

const Paper = () => {
  const [numPages, setNumPages] = useState(null);
  const [pageNumber, setPageNumber] = useState(1);
  const [scale, setScale] = useState(1.2); // zoom factor
  const [continuous, setContinuous] = useState(false);
  const [loadError, setLoadError] = useState("");

  const pdfFile = "/Files/TEST DOCUMENT FOR WEB DEVELOPMENT.pdf";

  const onDocumentLoadSuccess = ({ numPages }) => {
    setNumPages(numPages);
    setPageNumber(1);
    setLoadError("");
  };

  const onDocumentLoadError = (err) => {
    console.error("PDF load error:", err);
    setLoadError("Failed to load PDF file.");
  };

  const goToPrevPage = () => setPageNumber((p) => Math.max(p - 1, 1));
  const goToNextPage = () => setPageNumber((p) => Math.min(p + 1, numPages));
  const handlePageInput = (e) => {
    const val = Number(e.target.value);
    if (!isNaN(val) && val >= 1 && val <= numPages) {
      setPageNumber(val);
    }
  };

  const zoomIn = () => setScale((s) => s + 0.2);
  const zoomOut = () => setScale((s) => Math.max(s - 0.2, 0.6));
  const resetZoom = () => setScale(1.2);

  return (
    <div className="paper-container">
      <h1 className="paper-title">Research Paper Viewer</h1>

      {/* Controls */}
      <div className="paper-controls">
        <button onClick={goToPrevPage} disabled={pageNumber <= 1}>
          ⬅ Prev
        </button>
        <span>
          Page{" "}
          <input
            type="number"
            value={pageNumber}
            min={1}
            max={numPages || 1}
            onChange={handlePageInput}
            className="page-input"
          />{" "}
          of {numPages || "?"}
        </span>
        <button onClick={goToNextPage} disabled={pageNumber >= numPages}>
          Next ➡
        </button>

        <div className="zoom-controls">
          <button onClick={zoomOut}>➖</button>
          <button onClick={resetZoom}>⟳</button>
          <button onClick={zoomIn}>➕</button>
        </div>

        <label className="toggle">
          <input
            type="checkbox"
            checked={continuous}
            onChange={() => setContinuous(!continuous)}
          />
          Continuous Scroll
        </label>
      </div>

      {/* PDF Viewer */}
      <div className="paper-viewer scroll-mode">
        <Document
          file={pdfFile}
          onLoadSuccess={onDocumentLoadSuccess}
          onLoadError={onDocumentLoadError}
          loading={<p>Loading PDF…</p>}
          error={<p>{loadError || "Failed to load PDF file."}</p>}
          className="pdf-document"
        >
          {continuous
            ? // Render all pages
              Array.from(new Array(numPages), (_, i) => (
                <Page
                  key={`page_${i + 1}`}
                  pageNumber={i + 1}
                  scale={scale}
                  className="pdf-page"
                  renderTextLayer={false}
                  renderAnnotationLayer={false}
                />
              ))
            : // Render one page at a time
              numPages && (
                <Page
                  pageNumber={pageNumber}
                  scale={scale}
                  className="pdf-page"
                  renderTextLayer={false}
                  renderAnnotationLayer={false}
                />
              )}
        </Document>
      </div>

      {/* Download */}
      <div className="paper-download">
        <a href={pdfFile} download className="download-btn">
          ⬇ Download PDF
        </a>
      </div>
    </div>
  );
};

export default Paper;
